@testset "1.2.1.4 (d+e x)^m (f+g x)^n (a+b x+c x^2)^p" begin
    (a, b, c, d, e, f, g, m, n, p, x, ) = @variables a b c d e f g m n p x

    #= ::Package:: =#

    #= ::Title::Closed:: =#
    #=Integrands*of*the*form*(g*x)^m*(d+e*x)^n*(a+b*x+c*x^2)^p=#


    #= ::Section::Closed:: =#
    #=Integrands*of*the*form*(g*x)^m*(d+e*x)^n*(a+b*x+c*x^2)^p*when*b=0*and*c*d^2+a*e^2=0=#


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*x^m*(d+e*x)^1*(d^2 - e^2*x^2)^(p/2)=#


    #= ::Subsubsection::Closed:: =#
    #=p>0=#


    @test_int [x^2*(d + e*x)*(d^2 - e^2*x^2)^(1/2), x, 10, (d^3*x*sqrt(d^2 - e^2*x^2))/(8*e^2) - (d^2*(d^2 - e^2*x^2)^(3/2))/(3*e^3) - (d*x*(d^2 - e^2*x^2)^(3/2))/(4*e^2) + (d^2 - e^2*x^2)^(5/2)/(5*e^3) + (d^5*atan((e*x)/sqrt(d^2 - e^2*x^2)))/(8*e^3)]


    @test_int [x^4*(d + e*x)*(d^2 - e^2*x^2)^(3/2), x, 8, (3*d^7*x*sqrt(d^2 - e^2*x^2))/(128*e^4) + (d^5*x*(d^2 - e^2*x^2)^(3/2))/(64*e^4) - (4*d^2*x^2*(d^2 - e^2*x^2)^(5/2))/(63*e^3) - (d*x^3*(d^2 - e^2*x^2)^(5/2))/(8*e^2) - (x^4*(d^2 - e^2*x^2)^(5/2))/(9*e) - (d^3*(128*d + 315*e*x)*(d^2 - e^2*x^2)^(5/2))/(5040*e^5) + (3*d^9*atan((e*x)/sqrt(d^2 - e^2*x^2)))/(128*e^5)]
    @test_int [x^3*(d + e*x)*(d^2 - e^2*x^2)^(3/2), x, 7, (3*d^6*x*sqrt(d^2 - e^2*x^2))/(128*e^3) + (d^4*x*(d^2 - e^2*x^2)^(3/2))/(64*e^3) - (d*x^2*(d^2 - e^2*x^2)^(5/2))/(7*e^2) - (x^3*(d^2 - e^2*x^2)^(5/2))/(8*e) - (d^2*(32*d + 35*e*x)*(d^2 - e^2*x^2)^(5/2))/(560*e^4) + (3*d^8*atan((e*x)/sqrt(d^2 - e^2*x^2)))/(128*e^4)]
    @test_int [x^2*(d + e*x)*(d^2 - e^2*x^2)^(3/2), x, 12, (d^5*x*sqrt(d^2 - e^2*x^2))/(16*e^2) + (d^3*x*(d^2 - e^2*x^2)^(3/2))/(24*e^2) - (d^2*(d^2 - e^2*x^2)^(5/2))/(5*e^3) - (d*x*(d^2 - e^2*x^2)^(5/2))/(6*e^2) + (d^2 - e^2*x^2)^(7/2)/(7*e^3) + (d^7*atan((e*x)/sqrt(d^2 - e^2*x^2)))/(16*e^3)]
    @test_int [x^1*(d + e*x)*(d^2 - e^2*x^2)^(3/2), x, 5, (d^4*x*sqrt(d^2 - e^2*x^2))/(16*e) + (d^2*x*(d^2 - e^2*x^2)^(3/2))/(24*e) - ((6*d + 5*e*x)*(d^2 - e^2*x^2)^(5/2))/(30*e^2) + (d^6*atan((e*x)/sqrt(d^2 - e^2*x^2)))/(16*e^2)]
    @test_int [x^1*(d + e*x)*(d^2 - e^2*x^2)^(3/2), x, 5, (d^4*x*sqrt(d^2 - e^2*x^2))/(16*e) + (d^2*x*(d^2 - e^2*x^2)^(3/2))/(24*e) - ((6*d + 5*e*x)*(d^2 - e^2*x^2)^(5/2))/(30*e^2) + (d^6*atan((e*x)/sqrt(d^2 - e^2*x^2)))/(16*e^2)]
    @test_int [(d + e*x)*(d^2 - e^2*x^2)^(3/2)/x^1, x, 8, (1/8)*d^2*(8*d + 3*e*x)*sqrt(d^2 - e^2*x^2) + (1/12)*(4*d + 3*e*x)*(d^2 - e^2*x^2)^(3/2) + (3/8)*d^4*atan((e*x)/sqrt(d^2 - e^2*x^2)) - d^4*atanh(sqrt(d^2 - e^2*x^2)/d)]
    @test_int [(d + e*x)*(d^2 - e^2*x^2)^(3/2)/x^2, x, 8, (1/2)*d*e*(2*d - 3*e*x)*sqrt(d^2 - e^2*x^2) - ((3*d - e*x)*(d^2 - e^2*x^2)^(3/2))/(3*x) - (3/2)*d^3*e*atan((e*x)/sqrt(d^2 - e^2*x^2)) - d^3*e*atanh(sqrt(d^2 - e^2*x^2)/d)]
    @test_int [(d + e*x)*(d^2 - e^2*x^2)^(3/2)/x^3, x, 8, -((3*d*e*(d + e*x)*sqrt(d^2 - e^2*x^2))/(2*x)) - ((d - e*x)*(d^2 - e^2*x^2)^(3/2))/(2*x^2) - (3/2)*d^2*e^2*atan((e*x)/sqrt(d^2 - e^2*x^2)) + (3/2)*d^2*e^2*atanh(sqrt(d^2 - e^2*x^2)/d)]
    @test_int [(d + e*x)*(d^2 - e^2*x^2)^(3/2)/x^4, x, 8, (e^2*(2*d - 3*e*x)*sqrt(d^2 - e^2*x^2))/(2*x) - ((2*d + 3*e*x)*(d^2 - e^2*x^2)^(3/2))/(6*x^3) + d*e^3*atan((e*x)/sqrt(d^2 - e^2*x^2)) + (3/2)*d*e^3*atanh(sqrt(d^2 - e^2*x^2)/d)]
    @test_int [(d + e*x)*(d^2 - e^2*x^2)^(3/2)/x^5, x, 8, (e^2*(3*d + 8*e*x)*sqrt(d^2 - e^2*x^2))/(8*x^2) - ((3*d + 4*e*x)*(d^2 - e^2*x^2)^(3/2))/(12*x^4) + e^4*atan((e*x)/sqrt(d^2 - e^2*x^2)) - (3/8)*e^4*atanh(sqrt(d^2 - e^2*x^2)/d)]
    @test_int [(d + e*x)*(d^2 - e^2*x^2)^(3/2)/x^6, x, 6, (3*e^3*sqrt(d^2 - e^2*x^2))/(8*x^2) - (e*(d^2 - e^2*x^2)^(3/2))/(4*x^4) - (d^2 - e^2*x^2)^(5/2)/(5*d*x^5) - (3*e^5*atanh(sqrt(d^2 - e^2*x^2)/d))/(8*d)]
    @test_int [(d + e*x)*(d^2 - e^2*x^2)^(3/2)/x^7, x, 7, (e^4*sqrt(d^2 - e^2*x^2))/(16*d*x^2) - (e^2*(d^2 - e^2*x^2)^(3/2))/(24*d*x^4) - (d^2 - e^2*x^2)^(5/2)/(6*d*x^6) - (e*(d^2 - e^2*x^2)^(5/2))/(5*d^2*x^5) - (e^6*atanh(sqrt(d^2 - e^2*x^2)/d))/(16*d^2)]
    @test_int [(d + e*x)*(d^2 - e^2*x^2)^(3/2)/x^8, x, 8, (e^5*sqrt(d^2 - e^2*x^2))/(16*d^2*x^2) - (e^3*(d^2 - e^2*x^2)^(3/2))/(24*d^2*x^4) - (d^2 - e^2*x^2)^(5/2)/(7*d*x^7) - (e*(d^2 - e^2*x^2)^(5/2))/(6*d^2*x^6) - (2*e^2*(d^2 - e^2*x^2)^(5/2))/(35*d^3*x^5) - (e^7*atanh(sqrt(d^2 - e^2*x^2)/d))/(16*d^3)]
    @test_int [(d + e*x)*(d^2 - e^2*x^2)^(3/2)/x^9, x, 9, (3*e^6*sqrt(d^2 - e^2*x^2))/(128*d^3*x^2) - (e^4*(d^2 - e^2*x^2)^(3/2))/(64*d^3*x^4) - (d^2 - e^2*x^2)^(5/2)/(8*d*x^8) - (e*(d^2 - e^2*x^2)^(5/2))/(7*d^2*x^7) - (e^2*(d^2 - e^2*x^2)^(5/2))/(16*d^3*x^6) - (2*e^3*(d^2 - e^2*x^2)^(5/2))/(35*d^4*x^5) - (3*e^8*atanh(sqrt(d^2 - e^2*x^2)/d))/(128*d^4)]


    #= ::Subsubsection::Closed:: =#
    #=p<0=#


    @test_int [x^2*(d + e*x)/(d^2 - e^2*x^2)^(1/2), x, 8, -((d^2*sqrt(d^2 - e^2*x^2))/e^3) - (d*x*sqrt(d^2 - e^2*x^2))/(2*e^2) + (d^2 - e^2*x^2)^(3/2)/(3*e^3) + (d^3*atan((e*x)/sqrt(d^2 - e^2*x^2)))/(2*e^3)]


    @test_int [x^2*(d + e*x)/(d^2 - e^2*x^2)^(3/2), x, 5, (d*(d + e*x))/(e^3*sqrt(d^2 - e^2*x^2)) + sqrt(d^2 - e^2*x^2)/e^3 - (d*atan((e*x)/sqrt(d^2 - e^2*x^2)))/e^3]


    @test_int [x^2*(d + e*x)/(d^2 - e^2*x^2)^(5/2), x, 3, (x^2*(d + e*x))/(3*d*e*(d^2 - e^2*x^2)^(3/2)) - 2/(3*e^3*sqrt(d^2 - e^2*x^2))]


    @test_int [x^7*(d + e*x)/(d^2 - e^2*x^2)^(7/2), x, 6, (x^6*(d + e*x))/(5*e^2*(d^2 - e^2*x^2)^(5/2)) - (x^4*(6*d + 7*e*x))/(15*e^4*(d^2 - e^2*x^2)^(3/2)) + (x^2*(24*d + 35*e*x))/(15*e^6*sqrt(d^2 - e^2*x^2)) + ((32*d + 35*e*x)*sqrt(d^2 - e^2*x^2))/(10*e^8) - (7*d^2*atan((e*x)/sqrt(d^2 - e^2*x^2)))/(2*e^8)]
    @test_int [x^6*(d + e*x)/(d^2 - e^2*x^2)^(7/2), x, 6, (x^5*(d + e*x))/(5*e^2*(d^2 - e^2*x^2)^(5/2)) - (x^3*(5*d + 6*e*x))/(15*e^4*(d^2 - e^2*x^2)^(3/2)) + (x*(5*d + 8*e*x))/(5*e^6*sqrt(d^2 - e^2*x^2)) + (16*sqrt(d^2 - e^2*x^2))/(5*e^7) - (d*atan((e*x)/sqrt(d^2 - e^2*x^2)))/e^7]
    @test_int [x^5*(d + e*x)/(d^2 - e^2*x^2)^(7/2), x, 5, (x^4*(d + e*x))/(5*e^2*(d^2 - e^2*x^2)^(5/2)) - (x^2*(4*d + 5*e*x))/(15*e^4*(d^2 - e^2*x^2)^(3/2)) + (8*d + 15*e*x)/(15*e^6*sqrt(d^2 - e^2*x^2)) - atan((e*x)/sqrt(d^2 - e^2*x^2))/e^6]
    @test_int [x^4*(d + e*x)/(d^2 - e^2*x^2)^(7/2), x, 4, (x^4*(d + e*x))/(5*d*e*(d^2 - e^2*x^2)^(5/2)) - (4*d^2)/(15*e^5*(d^2 - e^2*x^2)^(3/2)) + 4/(5*e^5*sqrt(d^2 - e^2*x^2))]
    @test_int [x^3*(d + e*x)/(d^2 - e^2*x^2)^(7/2), x, 3, (x^2*(d + e*x))/(5*e^2*(d^2 - e^2*x^2)^(5/2)) - (2*d + 3*e*x)/(15*e^4*(d^2 - e^2*x^2)^(3/2)) + x/(5*d^2*e^3*sqrt(d^2 - e^2*x^2))]
    @test_int [x^2*(d + e*x)/(d^2 - e^2*x^2)^(7/2), x, 3, (x^2*(d + e*x))/(5*d*e*(d^2 - e^2*x^2)^(5/2)) - (2*(d - e*x))/(15*d*e^3*(d^2 - e^2*x^2)^(3/2)) - (2*x)/(15*d^3*e^2*sqrt(d^2 - e^2*x^2))]
    @test_int [x^1*(d + e*x)/(d^2 - e^2*x^2)^(7/2), x, 3, (d + e*x)/(5*e^2*(d^2 - e^2*x^2)^(5/2)) - x/(15*d^2*e*(d^2 - e^2*x^2)^(3/2)) - (2*x)/(15*d^4*e*sqrt(d^2 - e^2*x^2))]
    @test_int [x^0*(d + e*x)/(d^2 - e^2*x^2)^(7/2), x, 3, (d + e*x)/(5*d*e*(d^2 - e^2*x^2)^(5/2)) + (4*x)/(15*d^3*(d^2 - e^2*x^2)^(3/2)) + (8*x)/(15*d^5*sqrt(d^2 - e^2*x^2))]
    @test_int [(d + e*x)/(x^1*(d^2 - e^2*x^2)^(7/2)), x, 7, (d + e*x)/(5*d^2*(d^2 - e^2*x^2)^(5/2)) + (5*d + 4*e*x)/(15*d^4*(d^2 - e^2*x^2)^(3/2)) + (15*d + 8*e*x)/(15*d^6*sqrt(d^2 - e^2*x^2)) - atanh(sqrt(d^2 - e^2*x^2)/d)/d^6]
    @test_int [(d + e*x)/(x^2*(d^2 - e^2*x^2)^(7/2)), x, 7, (d + e*x)/(5*d^2*x*(d^2 - e^2*x^2)^(5/2)) + (6*d + 5*e*x)/(15*d^4*x*(d^2 - e^2*x^2)^(3/2)) + (8*d + 5*e*x)/(5*d^6*x*sqrt(d^2 - e^2*x^2)) - (16*sqrt(d^2 - e^2*x^2))/(5*d^7*x) - (e*atanh(sqrt(d^2 - e^2*x^2)/d))/d^7]
    @test_int [(d + e*x)/(x^3*(d^2 - e^2*x^2)^(7/2)), x, 8, (d + e*x)/(5*d^2*x^2*(d^2 - e^2*x^2)^(5/2)) + (7*d + 6*e*x)/(15*d^4*x^2*(d^2 - e^2*x^2)^(3/2)) + (35*d + 24*e*x)/(15*d^6*x^2*sqrt(d^2 - e^2*x^2)) - (7*sqrt(d^2 - e^2*x^2))/(2*d^7*x^2) - (16*e*sqrt(d^2 - e^2*x^2))/(5*d^8*x) - (7*e^2*atanh(sqrt(d^2 - e^2*x^2)/d))/(2*d^8)]


    @test_int [x^2*(d + e*x)/(d^2 - e^2*x^2)^(9/2), x, 4, (x^2*(d + e*x))/(7*d*e*(d^2 - e^2*x^2)^(7/2)) - (2*(d - 2*e*x))/(35*d*e^3*(d^2 - e^2*x^2)^(5/2)) - (4*x)/(105*d^3*e^2*(d^2 - e^2*x^2)^(3/2)) - (8*x)/(105*d^5*e^2*sqrt(d^2 - e^2*x^2))]

    @test_int [x^2*(d + e*x)/(d^2 - e^2*x^2)^(11/2), x, 5, (x^2*(d + e*x))/(9*d*e*(d^2 - e^2*x^2)^(9/2)) - (2*(d - 3*e*x))/(63*d*e^3*(d^2 - e^2*x^2)^(7/2)) - (2*x)/(105*d^3*e^2*(d^2 - e^2*x^2)^(5/2)) - (8*x)/(315*d^5*e^2*(d^2 - e^2*x^2)^(3/2)) - (16*x)/(315*d^7*e^2*sqrt(d^2 - e^2*x^2))]


    @test_int [x^2*(1 - a*x)/(1 - a^2*x^2)^(3/2), x, 4, -((1 - a*x)/(a^3*sqrt(1 - a^2*x^2))) - sqrt(1 - a^2*x^2)/a^3 - asin(a*x)/a^3]


