    @test_int [x^3*(d + e*x)^2/sqrt(d^2 - e^2*x^2), x, 6, -((3*d^2*x^2*sqrt(d^2 - e^2*x^2))/(5*e^2)) - (d*x^3*sqrt(d^2 - e^2*x^2))/(2*e) - (1/5)*x^4*sqrt(d^2 - e^2*x^2) - (3*d^3*(8*d + 5*e*x)*sqrt(d^2 - e^2*x^2))/(20*e^4) + (3*d^5*atan((e*x)/sqrt(d^2 - e^2*x^2)))/(4*e^4)]
